collection.ANDROID_ICS_STANDARD_SIZE = 48;
collection.getScaleRatio = function () {
    //var scale = collection.properties.scale.value;
    //if (scale == "small") return 30 / 48;
    //if (scale == "normal") return 36 / 48;
    return 1;
};
collection.getBaseSize = function () {
    return collection.getScaleRatio() * collection.ANDROID_ICS_STANDARD_SIZE;
};

collection.getThemeAwareColor = function (shapeColor, shapeTheme, type, disabled) {
    var currentThemeColor = collection.properties.defaultColorTheme.value.value == 'dark' ?
                                collection.properties["defaultDark" + type + "Color"].value : 
                                    collection.properties["defaultLight" + type + "Color"].value;
    var color = shapeColor;
    if (shapeColor.toString() == currentThemeColor.toString()) {
        color = shapeTheme.value == 'dark' ? 
                collection.properties["defaultDark" + type + "Color"].value : 
                collection.properties["defaultLight" + type + "Color"].value;
    }

    if (disabled.value) color = color.hollowed(0.7);

    return color;
};
collection.getWrappedTextTransform = function (x, centerY, name, font) {
    return [translate(x, (font.getPixelHeight() * 5 / 6) + centerY - F.textSize(name).h / 2)];
};

