var items = $content.value.split(/\n/);
var HEIGHT = 47;
var PADDING = 10;

//find the selected index and calculate the shift

var selectedPosition = 0;
for (var i = 0; i < items.length; i ++) {
    var item = items[i].trim();
    if (item.match(/^(.+)\*$/)) {
        selectedPosition = i;
        break;
    }
}

var shift = 0 - selectedPosition * HEIGHT;

var specs = [];
var top = $box.h / 2 - HEIGHT / 2;

for (var i = 0; i < items.length; i ++) {
    var text = items[i];
    text = text.replace(/\*$/, "");
    var size = collection._sizes[i];
    var left = PADDING + ($box.w - 2 * PADDING - size.w) * $textAlign.h / 2;
    var y = top + HEIGHT / 2 - size.dy - $textFont.getPixelHeight() / 2 + shift;


    //shadow for the selected item


    if (text.match(/^(.+)\@$/)) {
        text = text.replace(/\@$/, "");
        if (i == selectedPosition) {
            specs.push({
                _name: "text",
                _uri: "http://www.w3.org/2000/svg",
                x: left,
                y: y + 1,
                _text : text,
                stroke: "none",
                fill: "#FFFFFF",
                opacity: 0.5
            });
        }   
        specs.push({
            _name: "text",
            _uri: "http://www.w3.org/2000/svg",
            x: left,
            y: y,
            _text : text,
            fill: $selectedTextColor.toRGBString()
        });
    } else {
        if (i == selectedPosition) {
            specs.push({
                _name: "text",
                _uri: "http://www.w3.org/2000/svg",
                x: left,
                y: y + 1,
                _text : text,
                stroke: "none",
                fill: "#FFFFFF",
                opacity: 0.5
            });
        }
            specs.push({
                _name: "text",
                _uri: "http://www.w3.org/2000/svg",
                x: left,
                y: y,
                _text : text
            });
    }


    top += HEIGHT;
} 

Dom.newDOMFragment(specs);

